import React from 'react';
import { useNavigate } from 'react-router-dom';
import useLogout from '../hooks/useLogout';

function NavigationButtons({ showBackToAll, onBackToAll }) {
    const navigate = useNavigate();
    const logout = useLogout();

    const handleDashboard = () => {
        navigate('/landing');  // Navigate to the dashboard page (Landing page in this case)
    };

    const handleBack = () => {
        navigate(-1);  // Navigate to the previous page in history
    };

    return (
        <div style={{ display: 'flex', gap: '10px', marginBottom: '20px' }}>
            <button classname="nav-button" onClick={handleBack}>Dashboard</button>
            {showBackToAll && (
                <button onClick={onBackToAll}>Back to All Accounts</button>
            )}
            <button classname="nav-button" onClick={logout}>Logout</button>
        </div>
    );
}

export default NavigationButtons;
